import React from 'react';
import { View, StyleSheet, Dimensions, Image } from 'react-native';
import { Text, Button, Surface } from 'react-native-paper';

interface GlobalErrorModalProps {
  visible: boolean;
  errorMessage: string;
  onDismiss: () => void;
}

const { width, height } = Dimensions.get('window');

export const GlobalErrorModal: React.FC<GlobalErrorModalProps> = ({
  visible,
  errorMessage,
  onDismiss,
}) => {
  if (!visible) return null;

  return (
    <View style={styles.overlay}>
      <Surface style={styles.modal} elevation={8}>
        <View style={styles.content}>
          <Text variant="titleLarge" style={styles.title}>
            Oh my days...
          </Text>
          
          {/* Add your image here - using base64 for instant loading */}
          <Image 
            source={{ uri: 'data:image/png;base64,' }} 
            style={styles.errorImage}
            resizeMode="contain"
          />
          
          <Text variant="bodyMedium" style={styles.message}>
            {errorMessage.length > 100 
              ? `${errorMessage.substring(0, 100)}...` 
              : errorMessage
            }
          </Text>
          
          <Button
            mode="contained"
            onPress={onDismiss}
            style={styles.dismissButton}
            buttonColor="#6366f1"
          >
            Take me home!
          </Button>
        </View>
      </Surface>
    </View>
  );
};

const styles = StyleSheet.create({
  overlay: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: 'rgba(0, 0, 0, 0.6)',
    justifyContent: 'center',
    alignItems: 'center',
    padding: 20,
    zIndex: 9999,
  },
  modal: {
    width: '100%',
    maxWidth: 400,
    borderRadius: 16,
    backgroundColor: '#fff8e6',
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 4,
    },
    shadowOpacity: 0.25,
    shadowRadius: 8,
    elevation: 10,
  },
  content: {
    padding: 32,
    alignItems: 'center',
  },
  title: {
    marginBottom: 16,
    textAlign: 'center',
    fontWeight: 'bold',
    color: '#5D8658',
  },
  message: {
    marginBottom: 32,
    textAlign: 'center',
    opacity: 0.8,
    lineHeight: 20,
  },
  dismissButton: {
    paddingHorizontal: 32,
    paddingVertical: 8,
  },
  errorImage: {
    width: 120,
    height: 120,
    marginVertical: 16,
  },
});
